INSERT INTO `contents` (`id`, `label`, `title`, `description`, `created`, `user_id`) VALUES
(1, 'importantinfo', 'Important Info', '<p>1. VERY IMPORTANT - The measurements supplied to the Manufacturer must be the <strong>build sizes</strong>. Please do not supply frame or opening sizes.</p><p>2. 16mm Fringe Pile is included in the cost and will be supplied with Bug Strip.</p><p>3. Both Horizontals and Verticals must be equal. No Trapezoids/Trapeziums</p><p>4. Additional Sections will be supplied at the same colour of the Security Screens unless otherwise requested.</p><p>5. When including Double Hinged Doors to an Order, the “T-Mullion” must be selected from the Additional Sections and a “Flush Bolt Dble Sec Door” from the Accessories for each set of doors added.</p><p>6. All Screens are collect unless otherwise agreed.</p>', '0000-00-00 00:00:00', 54),
(2, 'importantinfo', 'Important Info2', '<p>1. VERY IMPORTANT - The measurements supplied to the Manufacturer must be the <strong>build sizes</strong>. Please do not supply frame or opening sizes.</p><p>2. 16mm Fringe Pile is included in the cost and will be supplied with Bug Strip.</p><p>3. Both Horizontals and Verticals must be equal. No Trapezoids/Trapeziums</p><p>4. Additional Sections will be supplied at the same colour of the Security Screens unless otherwise requested.</p><p>5. When including Double Hinged Doors to an Order, the “T-Mullion” must be selected from the Additional Sections and a “Flush Bolt Dble Sec Door” from the Accessories for each set of doors added.</p><p>6. All Screens are collect unless otherwise agreed.</p>', '0000-00-00 00:00:00', 57);
